import React from 'react';
import './GreenBox.css';

const GreenPaddingWhiteFill = () => {
    return (
      <div className="green-bg">
        <div className="padding-container">
          <p>This is content inside a white box with padding on a green background.</p>
        </div>
      </div>
    );
  };
  
  export default GreenPaddingWhiteFill;
